export const inflationInit = {
    "cpi_fed_explain" : {
        "explain1" : "長期的高通膨會引來嚴重的效應",
        "explain2" : "直接相關的商品會率先漲價，連帶間接相關的商品漲價",
        "explain3" : "通膨預期心理也會導致，各行各業重新定價",
        "explain4" : "最後通膨不斷創新高"
    }
}
